(function($) {
    'use strict';

    //Window and Top Level/Global Events
    var Carousel = (function(App) {
        return App = {
             $el: $('html'),

            client: {
                type: Snuffr.getDeviceType(),
                browser: Snuffr.getBrowser(),
                os: Snuffr.getOS(),
                orientation: null
            },

                init: function() {
                     // App.carousels.single();
                     // App.carousels.heros();
                    $(window).on('load orientationchange resize', function(){
                        App.carousels.multiple();
                        App.carousels.single();
                        App.carousels.heros();
                    });
                    $(window).on('resize', function(){
                        App.carousels.resizeMultiCarousel();
                    });
                },

                carousels: {
                        // Single Carousel
                        single: function() {
                        $('.carousel.single').each(function () {

                            var minH, bannerAspectRatio, bannerHeight, bannerWidth;
                            if ($(this).parents().hasClass('module-story-banner-homepage')) {
                                bannerWidth = $('.module-story-banner-homepage').width();
                                if ($(window).width() > $(window).height()) {
                                    bannerAspectRatio = 2.5;
                                }
                                else {
                                    bannerAspectRatio = 0.93;
                                }
                            }

                            else if ($(this).parents().hasClass('module-story-banner-standard')) {
                                bannerWidth = $('.module-story-banner-standard').width();
                                if ($(window).width() > $(window).height()) {
                                    bannerAspectRatio = 3;
                                }
                                else {
                                    bannerAspectRatio = 1.1;
                                }
                            }

                            bannerHeight = resizeRendition(bannerWidth, bannerAspectRatio);
                            minH = parseInt(bannerHeight, 10);

                            $(this)
                                .css('min-height', minH)
                                .find('.item, .inner, .inner > div')
                                .css('min-height', minH);
                            var actualHeight = $(this).find('.inner.container').outerHeight();
                            var navHeight = 0;
                            if ($('html').hasClass('no-touch') &&($(this).parent().hasClass('module-story-banner-standard') || $(this).parent().hasClass('module-story-banner-homepage'))) {
                                navHeight = $('.navs header').height() -25;
                            } else {
                                navHeight = 0;
                            }
                        });
                    
                        if($('.module-story-banner-standard').find('video').length){
                            $('.module-story-banner-standard').find('video').height($('.module-story-banner-standard').height())
                        }
                    },

                        // Multiple Carousel
                        multiple: function() {
                            var multiCarousel = $('.carousel.multiple.slick-initialized');
                            $.each(multiCarousel, function (carouselIndex, carouselValue) {
                                var slideContainer = $(carouselValue).find('.slick-track'),
                                    slides = $(carouselValue).find('.slick-slide'),
                                    maxHeight = 0;

                                if ($(slides).height() != 'auto') $(slides).height('auto');


                                function setHeight() {
                                    $.each(slides, function (index, slidesList) {
                                        if ($(slidesList).height() > maxHeight) {
                                            $(slidesList).css({'height' : '',
                                                                    'min-height' : ''
                                                    });
                                            maxHeight = $(slidesList).height();
                                        }
                                    });
                                    if ($(slides).parents('.module-story-snippet-visual-text').length > 0){
                                        if($(window).width() >= 767){
                                            $('.module-story-snippet-visual-text .slick-slide').css('min-height', '');
                                            $('.module-story-snippet-visual-text .slick-slide').each(function(){
                                                $(this).find('.table-container').outerHeight($(this).parents('.carousel').height() - $(this).find('.graph-text').outerHeight());
                                            });
                                        }
                                        if($(window).width()>1024) {
                                            if($(carouselValue).find('.item-image').length == 0)
                                            {
                                                $(carouselValue).height(maxHeight);
                                            }
                                        }
                                    }
                                    else
                                        $(slides).css('height', maxHeight+'px');
                                }
                                setHeight();
                                setTimeout (function () {
                                    setHeight();
                                },500);
                            })
                        },

                        // Resize multiple carousel on browser resize
                        resizeMultiCarousel :function(){
                            var multiCarousel = $('.carousel.multiple.slick-initialized'),
                                slideContainer = $(multiCarousel).find('.slick-track');
                            if($(window).width()>1024){
                                  slideContainer.css('-webkit-transform', 'translate3d(0px, 0px, 0px)');
                              }
                        },

                        // Hero carousel
                        heros: function() {
                            $('section.module-story-banner-standard').each(function() {
                                var subnavH;

                                if ($(this).is('.module-hero')) {
                                    var subnavPage = ($('.module-navigation-secondary').length && App.$el.width() > 1024) ? true : false;
                                    subnavH = subnavPage ? $('.module-navigation-secondary').height() : 0;
                                } else {
                                    subnavH = 0;
                                }

                                var minH = (screen.height * .498) + subnavH;

                                $(this)
                                    .css('min-height', 'minH')
                                    .css('height', 'minH')
                                    .find('> div, .item, .inner, .inner > div')
                                    .css('height', 'minH')
                                    .css('min-height', 'minH');
                            });

                        }
                    }
            }
    })(Carousel || {}).init(); // Self firing
})(jQuery);

$(window).on('resize load', function() {
    resizestorysnippetcards();
});
$(document).ready(function() {
    resizestorysnippetcards();
});

// Height Calculation make all same height
function resizestorysnippetcards() {
    var maxHeight = 0;
    var heightofItem;
    $('.module-story-snippet-cards .item').css('height', 'auto');
    $('.module-story-snippet-cards .item').each(function() {
        heightofItem = $(this).height();
        if (heightofItem > maxHeight) {
            maxHeight = heightofItem;
        }

    });
    $('.module-story-snippet-cards .item').height(maxHeight);
}

