$(function() {
    $(".getCert").click(function(event) {
        event.preventDefault();

        var error = false;
        var catNbr = $("input[name='catalogTitle']").val().trim();
        var lotNbr = $("input[name='lotTitle']").val().trim();
        if (!catNbr) {
            $('.catError').removeClass('hidden');
        } else {
            $('.catError').addClass('hidden');
        }
        if (!lotNbr) {
            $('.lotError').removeClass('hidden');
        } else {
            $('.lotError').addClass('hidden');
        }
        if (!catNbr || !lotNbr) {
            error = true;
        }

        if (!error) {
            $.ajax({
                url: '/cornservice/CertificateLookupModuleServlet',
                dataType: 'json',
                data: { catalogNumber:catNbr ,lotNumber:lotNbr },
                success: function(data) {
                    if (data.ClientResponse=='true') {
                        $('.errorLine').text('');
                        window.open(data.clientResponseBody, '_blank');
                    } else {
                        var dataErr = document.getElementsByClassName("errorLine")[0].getAttribute("data-errormessage");
                        var errMsg = (dataErr > "") ? dataErr : "If you are experiencing difficulties retrieving the Certificate, please contact customer service.";
                        if (data.clientResponseBody) {
                            $('.errorLine').html('<p>'+data.clientResponseBody+'</p> '+errMsg);
                        } else {
                            $('.errorLine').html(errMsg);
                        }
                    }
                },
                error: function() {
                    console.log('** Error ');
                }
            });
        }
    });

    $(".questionMark").click(function(event) {
        if ( $('.lotDesc').hasClass('hidden') ) {
            $('.lotDesc').removeClass('hidden');
        } else {
            $('.lotDesc').addClass('hidden');
        }
    });
    $(".lotDesc .closeBtn").click(function(event) {
        $('.lotDesc').addClass('hidden');
    });
});
