// set height 
function heightCalc(){
  if($(window).width()>767){
    $('.module-event-mulitile .featured').css('height','auto');
    var heightfeatured=$('.module-event-mulitile .featured').height();
    var heightarticle=$('.module-event-mulitile article').height();
    if(heightfeatured<heightarticle){
        $('.module-event-mulitile .featured').height(heightarticle);
    }
  }
  else{
    $('.module-event-mulitile .featured').css('height','250');
  }
}
