$(document).ready(function() {
    function getSetHts(){
        //loop through all rows
        $('.product-detail-editorial .item-wrapper.standard-tab').each(function(i,val){
            //inside each row, get all .inner elems
            var $li = $(val).find('ul').find('.tab-link').find('.inner');
            //setup height array
            var hts = [];
            //push heights into array
            $li.each(function(i,val){
                hts.push($(val).outerHeight());
            })
            //get the largest height from from array
            var maxht = Math.max.apply(Math, hts);
            //set the min-height to the largest height on screens > 767, remove if < 767
            $li.each(function(i,val){
                if($(window).width() > 767){
                    $(this).closest('.tab-link').css('min-height', maxht); 
                } else {
                    $(this).closest('.tab-link').removeAttr('style'); 
                }
            })
        })
    }
    //get and set heights  
    $(window).on('resize load', getSetHts);
});


(function($) {

    var tabbedContent = {
        //initiate method
        init: function() {
            this.clickHandler();
        },

        clickHandler: function() {
            var self = this;

            $(window.document).on('click', '.standard-tab .tab-link .inner', function(){
                $el = $(this).parent();

                if($el.hasClass('current_new')){
                    $el.removeClass('current_new').removeClass('active');
                    $el.parent().parent().removeClass('active');

                } else {
                    $('.tabs .tab-link').removeClass('current_new').removeClass('active');
                    $('.item-wrapper.standard-tab').removeClass('active');

                    $el.addClass('current_new').addClass('active');
                    $el.parent().parent().addClass('active');
                }
                
                if($(window).width() < 1024 || ( $(window).width() > 1024 && $('.navs').hasClass('sticky')) ){
                    if( $('.breadcrumb-navigation').hasClass('sticky-breadcrumb') ){
                        var offset = 77;
                    } else {
                        var offset = 45;
                    }
                    $('html, body').animate({ scrollTop: $(this).offset().top - offset }, 200);
                } 
                $el.parent().parent().find('.show-content').html($el.find('.tab-content').html());
            })

            //Close button handler
            $('.standard-tab ul.tabs li.tab-link a.close-btn').on('click', function(e){
                e.preventDefault();
                e.stopPropagation();
                $(this).parent().parent().removeClass('current_new').removeClass('active');
                $(this).parent().parent().parent().parent().removeClass('active');
            })
        
            //Close button handler
            $(document).on('click', '.show-content .close-btn', function(e){
                e.preventDefault();
                e.stopPropagation();
                $('.standard-tab .tab-link').removeClass('current_new').removeClass('active');
                $('.tab-content, .show-content, .item-wrapper.standard-tab').removeClass('active');
            })

           
           
        }

    }

    tabbedContent.init();

})(jQuery);

