function hoverGlossary(){

 $.ajax({
      url : localeConfArray.homePage+'/header-footer/_jcr_content/footer.glossary.json',
      dataType: "json",
        async: true,
        success : function(glossary){
        glossaryData = glossary
            $(document).trigger('glossary', glossaryData)
          }
    })

    $(document).on('glossary', function(e, data){

    $('.glossaryWord').each(function(){
      var elm = $(this),
        dataTerm = elm.data('glossary'),
        dataId = elm.data('id'),
        imageURL = "";

      $.each(glossaryData.data, function(key, val){
        
        if(typeof dataTerm !== 'undefined'){
          if(dataTerm.toLowerCase() === val.keyValue.toLowerCase()){
              if(typeof val.item !== 'undefined'){
                $.each(val.item, function(k, v){
                 
                  if(typeof dataId !== 'undefined'){
                    if(dataId.toLowerCase() === v.title.toLowerCase()){
                       if(v.isWithImage == true){
                          imageURL = '<span class="glossaryimg"><img src="'+v.imageURL+ '" alt="'+v.imageAltText+'"/></span>';
                        }

                          elm.attr({
                            'data-content': imageURL + v.description,
                            'title' : v.title,
                            'data-original-title' : v.title
                          })
                    }
                  }
                })
            }
          }
        }

      })

       if(typeof $(this).data('content') === 'undefined'){
        $(this).removeClass('glossaryWord');
      }
      
    })

    })

     var popupInterval;

      $(document).on('click', function(e) {
      if (typeof $(e.target).data('original-title') == 'undefined' &&
         !$(e.target).parents().is('.popover.in')) {
        $('[data-original-title]').popover('hide');
      }
    });

    var showPopoverMobile = function () {
         $(".glossaryWord").popover('hide');
         $(this).popover('show');
      }

      var showPopover = function () {
        var self = $(this);
        setTimeout(function(){
           self.popover('show');
        }, 600);
      }

      var hidePopover = function(){
          var self = $(this);
          popupInterval = setTimeout(function(){
            self.popover('hide');
          }, 600);

          $(document).on('mouseenter', '.special-class', function(){
              clearTimeout(popupInterval);
          })
          $(document).on('mouseleave', '.special-class', function(){
              self.popover('hide');
          })
      }
  

      if($(window).width() > 1024){
      $(".glossaryWord").popover({
        trigger: 'manual',
        placement : function (context, source) {
            var position = $(source).offset();
              if (position.top < 200){
                  return "bottom";
              }else{
                return "top";
              }
        },
        template: '<div class="popover special-class"><button class="closebtn">&times</button><div class="arrow"></div><div class="popover-inner"><h3 class="popover-title"></h3><div class="popover-content"><p></p></div></div></div>',
        html : true,
        container: '.page'
      }).on('mouseenter', showPopover)
        .on('mouseleave', hidePopover)
        .on('shown.bs.popover', function(e){
            var $element = $(this);
           $(document).on("click", ".popover .closebtn", function(){
             $element.popover('hide');
          });

        });

  }else{
    $(".glossaryWord").popover({
        placement : function (context, source) {
           var position = $(source).offset();
              if (position.top < 400){
                  return "bottom";
              }else{
                return "top";
              }
        },
        template: '<div class="popover special-class"><button class="closebtn">&times</button><div class="arrow"></div><div class="popover-inner"><h3 class="popover-title"></h3><div class="popover-content"><p></p></div></div></div>',
        html : true,
        container: '.page',
        trigger: 'manual',
      }).click(showPopoverMobile)
        .on('shown.bs.popover', function(e){
            var $element = $(this);
           $(document).on("click", ".popover .closebtn", function(){
             $element.popover('hide');
          });

        });
     }

  $(document).on('slideChanged', function(e, elm){
    $(elm.$list[0]).find('.glossaryWord').popover('hide');
  })

}

hoverGlossary();
