$(document).ready( function() {
    $('.card > a').on('click', function(e){
        if($(this).find('.video').hasClass('video--modal')){
            e.preventDefault();
            $(this).find('.media__image [data-video-trigger]').trigger('click');
        }
    });

    function clearSrc(){
        if( $('[data-video]').find('iframe').length > 0 ){
            $('[data-video] iframe').attr('src', '');
        }
        if( $('[data-video]').find('video').length > 0 ){
            $('[data-video] video').attr('src', '');
        }

        //restart the slider the slider
        if( $('.banner--multiple').length ){
            $('.banner--multiple').slick('slickPlay');
        }
    }

    $('[data-video-trigger]').on('click', function(e){
        e.preventDefault();
        $this = $(this);

        //store video ID and SRC in vars
        var VIDEO_ID = $this.data('video-id');
        var VIDEO_SRC = $this.data('video-reference');

        // Pause banner--multiple carousel sliders in order to prevent logic conflict when authored on same page as other video components. Prevents the "clearSrc" function from firing on every Slick "onchange" event for banner--multiple components 
        if ( ('.banner--multiple').length ) {
            $('.banner--multiple').slick('slickPause');
        }

        $this.closest('[data-video]').addClass('active');

            //if we are in a card component
        if( $this.closest('.cards').length ){
            var $selector = $this.closest('.card__wrap');
            //if we are in a banner component
        } else if ( $this.closest('.banner-item').length ) {
            var $selector = $this.closest('.banner-item').find('.banner-item__media');

            //if we are somewhere else
        } else {
            var $selector = $this.closest('.media');
        }

        //if we are in a modal
        if( $this.data('video-trigger-type') == 'modal') {
            //remove the class if it exists
            $selector.find('.media__video').removeClass('detachedModal');

            //Stick the modal to the bottom of the page for zindex
            var modal = $selector.find('[data-video][data-video-modal]').detach();

            //add a class to this element only so we can find it later
            $selector.find('.media__video').addClass('detachedModal');
                    
            //append to the bottom of the page
            $('body').append(modal);

            $('body > [data-video-modal][data-video-id="'+VIDEO_ID+'"]').after('<div class="video-modal-overlay"></div>')
            $('body > [data-video][data-video-id="'+VIDEO_ID+'"]').addClass('active');
            $('body > [data-video][data-video-id="'+VIDEO_ID+'"] [data-video-player]').attr('src', VIDEO_SRC);
        
        } else {
            //if we are in an inline video
            $selector.find('.video').addClass('active');
            $selector.find('.video [data-video-player]').attr('src', VIDEO_SRC);
        }

    });


    //have to select with context as object created after DOM render (cloned)
    $('body').on('click', '.video-modal-close', function(e){

        e.preventDefault();
        //cache away
        var $this = $(this);
        $this.closest('[data-video-modal]').removeClass('active');

        //detach the modal now and store in a var to append back home
        var modal = $this.closest('[data-video-modal]').detach();

        //set up the base vars
        var VIDEO_ID = $this.closest('[data-video-modal]').data('video-id');
        var $thisMediaContainer = $('.media__video[data-video-id="'+VIDEO_ID+'"]');

        //in case of dupes on the page, if it has the detachedModal class only (meaning we detached it earlier), empty first, then append
        if( $thisMediaContainer.hasClass('detachedModal') ){
            $thisMediaContainer.empty().append(modal);
        }

        //remove the overlay
        $('.video-modal-overlay').remove();

        //clear the refs
        clearSrc();
    });



    $('.video-close').on('click', function(){
        $(this).closest('[data-video]').removeClass('active');
        clearSrc();
    });


    $('.banner--multiple').on('beforeChange', function(event, slick, currentSlide, nextSlide){
        $('[data-video]').removeClass('active');
        $(this).find('.slick-dots').removeClass('inactive');
        clearSrc();
    });


    $('.cards-nav-item > a').on('click', function(){
        $('[data-video]').removeClass('active');
        clearSrc()
    })
});

